<script>
	function delayClick(e, o, dt, tjcb){
		var t, target = o.target, h = o.href;
		if(!target || target == '_self'){
			!!tjcb && tjcb();
			if(h){
				t = setTimeout(function(){
					clearTimeout(t);
					location.href = h;
					return true;
				}, dt);
				if(e && e.preventDefault){
					e.preventDefault();
				}else{
					window.event.returnValue = false;
				}
				return false;
			}

		}
	}
</script>

